import * as types from './../contains/ActionTypes'

const initialState = [
    {
        id: 1,
        name: 'Học ReactJS',
        status: true
    }
];

const myReducer = (state = initialState, action) => {
    switch(action.type) {
        case types.LIST_ALL:
            return state;
        default: return state;
    }
}

export default myReducer;
